@DavidLimbaugh @The__Oath Our election machine is collapsing, and we gotta shore it up, asap.
...unless in a rage upon losing they bring it all down so bad that elections won't matter no more, but you know they hate elections anyway, and hated our country anyway, and have no brakes...

@DonaldJTrumpJr

@jfouse @JJ_Denhollander Finally, we know that God Himself installs Kings. Biblically, there is NO way to rage at Trump winning while praising God for His sovereignty and higher ways. If Trump wins, then it PLEASED GOD to give Him a 2nd Term. Can you stew w/out stewing at God Himself?
-- Dan 2:21

